import React from "react";

function TodoItem(props) {
  let items;
  return (
    <TodoItem>
      <div class="collapse" id="collapseExample">
        <div class="card card-body">{props.desc}</div>
      </div>
    </TodoItem>
  );
}

export default TodoItem;
